import React from 'react';
import image from '../image.jpg';
import { makeStyles } from '@material-ui/core/styles';


const useStyles = makeStyles(theme => ({
  picture: {
    padding:25,
    width:600,
    heigth:600,
    marginLeft:300,
  },
  tittle: {
    padding:15,
    marginLeft:370,
  },
}));

function Display() {

  const classes = useStyles();

    return (
      <div>
        <h1 className={classes.tittle}>You are visualizing Object.stl</h1>
        <img src={image} alt="img" className={classes.picture}/>
      </div>

      )
}

export default Display;
